// App.js - główny plik routingu
import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import LoginForm from './components/LoginForm';
import RegistrationForm from './components/RegistrationForm';
import Home from './components/Home'
import ReactDOM from 'react-dom';
//import routes from './components/routes'; // Zaimportuj zdefiniowane trasy

const App = () => {

  const App = () => {
    return (
      <div>
        {/* Sprawdź, czy LoginForm renderuje się poprawnie */}
        <LoginForm />

        {/* Sprawdź, czy RegistrationForm renderuje się poprawnie */}
        <RegistrationForm />

        {/* Sprawdź, czy Home renderuje się poprawnie */}
        <Home />
      </div>
    );
  };

  ReactDOM.render(<App />, document.getElementById('root'));
}
export default App;
